// src/Component/BorrowedList.js
import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchAllBorrowedBooks } from "../Features/BorrowedBookModelSlice";
import { Table, Container, Spinner } from "reactstrap";

const BorrowedList = () => {
  const dispatch = useDispatch();

  const { borrowedBooks, loading, error } = useSelector((state) => state.borrowed);

  const [search, setSearch] = useState("");

  // جلب كل الكتب المقترضة عند تحميل الصفحة
  useEffect(() => {
    dispatch(fetchAllBorrowedBooks());
  }, [dispatch]);

  // فلترة حسب اسم الطالب أو اسم الكتاب
  const filteredBooks = borrowedBooks.filter((b) => {
    const student = b.studentUsername?.toLowerCase() || "";
    const title = b.book?.title?.toLowerCase() || "";
    return (
      student.includes(search.toLowerCase()) ||
      title.includes(search.toLowerCase())
    );
  });

  return (
    <Container className="py-4">
      <h2 className="mb-4">Borrowed Books List (Admin)</h2>

      <input
        type="text"
        placeholder="Search by student or book title"
        value={search}
        onChange={(e) => setSearch(e.target.value)}
        style={{ marginBottom: "20px", padding: "8px", width: "100%" }}
      />

      {loading ? (
        <div style={{ textAlign: "center", marginTop: "20px" }}>
          <Spinner color="primary" />
        </div>
      ) : error ? (
        <p style={{ color: "red" }}>Error: {error}</p>
      ) : filteredBooks.length === 0 ? (
        <p style={{ textAlign: "center" }}>No borrowed books found.</p>
      ) : (
        <Table bordered hover responsive>
          <thead>
            <tr>
              <th>Student</th>
              <th>Book Title</th>
              <th>Author</th>
              <th>Year</th>
              <th>Borrowed At</th>
              <th>Returned?</th>
              <th>Rating</th>
              <th>Feedback</th>
            </tr>
          </thead>
          <tbody>
            {filteredBooks.map((b) => (
              <tr key={b._id}>
                <td>{b.studentUsername}</td>
                <td>{b.book?.title || "Book not found"}</td>
                <td>{b.book?.author || "-"}</td>
                <td>{b.book?.year || "-"}</td>
                <td>{new Date(b.borrowedAt).toLocaleString()}</td>
                <td>{b.returnedAt ? "Yes" : "No"}</td>
                <td>{b.rating || "-"}</td>
                <td>{b.feedback || "-"}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </Container>
  );
};

export default BorrowedList;
